pragma solidity ^0.4.18;

import './ADPChannel.sol';

contract ADPChannelManager {
	struct AddressWrapper {
		address channelAddress;
		bool isExist;
	}
  event Settlement(address fromAddress, address contractAddress, uint nonce, uint withdrawalAmount, ADPChannel.SettlementType settlementType);

  address Owner;
  mapping (address => mapping(address => AddressWrapper)) Channels;

  constructor() public {
  	Owner = msg.sender;
  }

  function createChannel(address token, address sender, address receiver, uint gracePeriod) public {

  	require (msg.sender == Owner);
  	require (!Channels[token][sender].isExist);
  	
    address addr = new ADPChannel(token, sender, receiver, this, gracePeriod);
    Channels[token][sender] = AddressWrapper(addr, true);
  }  

  function getChannel (address token, address sender) constant public returns(address) {
  	return Channels[token][sender].channelAddress;
  }

  function publishSettlement(address token, address sender,uint nonce, uint withdrawalAmount, ADPChannel.SettlementType settlementType) public {

    require (Channels[token][sender].channelAddress == msg.sender);

    emit Settlement(tx.origin, msg.sender, nonce, withdrawalAmount, settlementType);
  }
}
